using System.Xml.Schema;

class Day15
{
    private const int PART = 2;
    private const int TILE_WIDTH =   PART;
    private const int EMPTY_SPACE = -1;

    private struct Tile
    {
        public bool Dynamic;
        public char Char;
    }

    private int         _posX;
    private int         _posY;
    private int[,]      _world;
    private List<Tile>  _tiles = new();

    public Day15()
    {
        _posX = _posY = 0;
        _world = new int[s_data[0].Length * TILE_WIDTH, s_data.Length];

        for (int y = 0; y < _world.GetLength(1); ++y)
            for (int x = 0; x < _world.GetLength(0); ++x)
                _world[x, y] = EMPTY_SPACE;

        for (int y = 0; y < s_data.Length; ++y)
        {
            for (int x = 0; x < s_data[0].Length; ++x)
            {
                char tile = s_data[y][x];
                if (tile == '@')
                {
                    _posX = x * TILE_WIDTH;
                    _posY = y;
                }
                else if (tile == '#' || tile == 'O')
                {
                    _tiles.Add(new Tile
                    {
                        Dynamic = tile == 'O',
                        Char = tile
                    });

                    for (int i = 0; i < TILE_WIDTH; ++i) 
                        _world[TILE_WIDTH * x + i, y] = _tiles.Count - 1;
                }
            }
        }
    }

    private int fetchTileOffsets(int posX, int posY, out int[] offsets)
    {
        int numOffsets = 0;
        offsets = new int[TILE_WIDTH]; 
        if (_world[posX, posY] != EMPTY_SPACE)
        {
            for (int x = -TILE_WIDTH; x <= TILE_WIDTH; ++x)
            {
                if (_world[posX - x, posY] == _world[posX, posY])
                    offsets[numOffsets++] = -x;
            }
        }
        return numOffsets;
    }

    private void moveHorizontal(int dir)
    {
        int newX = _posX + dir;
        int tileId = _world[newX, _posY];

        if (tileId == EMPTY_SPACE)
        {
            _posX = newX;
        }
        else if (_tiles[tileId].Dynamic)
        {
            int x = newX;
            while (_world[x, _posY] != EMPTY_SPACE && _tiles[_world[x, _posY]].Dynamic)
                x += dir;

            if (_world[x, _posY] == EMPTY_SPACE)
            {
                if (x > newX)
                {
                    for (int i = x; i >= newX; --i)
                        _world[i, _posY] = _world[i - dir, _posY];
                }
                else
                {
                    for (int i = x; i <= newX; ++i)
                        _world[i, _posY] = _world[i - dir, _posY];
                }

                _posX = newX;
            }
        }
    }
    private void moveVertical(int dir)
    {
        int newY = _posY + dir;
        int tileId = _world[_posX, newY];

        if (tileId == EMPTY_SPACE)
        {
            _posY = newY;
        }
        else if (_tiles[tileId].Dynamic)
        {
            var tileQueue = new Queue<(int x, int y)>();
            var tilesToMove = new Stack<(int x, int y)>();
            bool blocked = false;

            tileQueue.Enqueue((_posX, newY));

            while (tileQueue.Count != 0)
            {
                var (x, y) = tileQueue.Dequeue();

                fetchTileOffsets(x, y, out int[] tile_offset);

                foreach (int offset in tile_offset)
                {
                    tileId = _world[x + offset, y + dir];
                    if (tileId != EMPTY_SPACE)
                    {
                        blocked |= _tiles[tileId].Dynamic == false;

                        if (_tiles[tileId].Dynamic)
                            tileQueue.Enqueue((x + offset, y + dir));
                    }
                }

                tilesToMove.Push((x, y));
            }

            if (!blocked)
            {
                while (tilesToMove.Count != 0)
                {
                    var (x, y) = tilesToMove.Pop();

                    if (fetchTileOffsets(x, y, out int[] tile_offsets) == 0)
                        continue;

                    foreach (int offset in tile_offsets)
                    {
                        _world[x + offset, y + dir] = _world[x + offset, y];
                        _world[x + offset, y] = EMPTY_SPACE;
                    }
                }

                _posY = newY;
            }
        }
    }

    private void Run()
    {
        foreach (var move in s_moves)
        {
            switch (move)
            {
                case '<': 
                    moveHorizontal(-1);
                    break;
                case '>':
                    moveHorizontal(1);
                    break;
                case '^':
                    moveVertical(-1);
                    break;
                case 'v':
                    moveVertical(1);
                    break;
            }
        }

        int score = 0;
        for (int y = 0; y < _world.GetLength(1); ++y)
        {
            for (int x = 0;  x != _world.GetLength(0); )
            {
                if (_world[x,y] != EMPTY_SPACE && _tiles[_world[x,y]].Dynamic)
                {
                    score += y * 100 + x;
                    x += TILE_WIDTH;
                }
                else
                {
                    ++x;
                }
            }
        }
        Console.WriteLine(score);
    }

    static void Main(string[] args)
    {
        new Day15().Run();
    }

